const input = ``;

const removeLetters = (input) => {
  for(let i = 0; i<input.length; i++){
    if((input.charAt(i).toUpperCase() === input.charAt(i+1) && input.charAt(i) !== input.charAt(i+1))
    || (input.charAt(i).toLowerCase() === input.charAt(i+1) && input.charAt(i) !== input.charAt(i+1))) {
      input = input.substr(0, i) + input.substr(i+2);
      if (i>0) {
        i = i-2;
      } else {
        i=i-2;
      }
    }
  }
  return input.length;
}

const removeLetter = (input) => {
  let allLetters = "ABCDEFGHIKLMNOPQRSTVXYZ";
  let answer = input.length;
  for(let i=0; i<allLetters.length; i++) {
    let letter = allLetters.charAt(i);
    let data = input.replace(new RegExp(letter, 'g'), "").replace(new RegExp(letter.toLowerCase(), 'g'), "");
    answer = answer > removeLetters(data) ? removeLetters(data) : answer;
  }
  return answer;
}

removeLetter(input);
